create table if not exists article
(
    uid              int auto_increment primary key,
    outlet           varchar(30)             not null,
    scrape_date      int(35)                 null,
    scrape_search    varchar(150)            not null,
    scrape_rank      int(8)                  not null,
    url              text                    not null,
    publication_date varchar(100) default '' not null,
    title            text                    null,
    text             text                    null,
    author           varchar(255) default '' null,
    presentation     varchar(150) default '' null
);

create table if not exists comment
(
    uid              int auto_increment primary key,
    article_uid      int(11)                 not null,
    rank             int(8)                  not null,
    title            text                    null,
    text             text                    null,
    commenter        varchar(255) default '' null,
    is_reply_to      int(11) default null    null
);

